INSERT INTO `blogs` VALUES (1,'1 Titulo blog','titulo-blog-123','Resumen blog que pretendo este limitado a 150 caracteres para ver donde corta, para esto tenemos que escribir mucho, para ver si hace 5 rows o hace 6 o mas de 10 rows, supuestamente esta limitado','Cuerpo del blog',1,3,NULL,'2023-01-01 11:00:00','2023-01-26 09:49:17'),(2,'Titulo blog2 asdf','titulo-blog-2asd','Titular del blog 2 borrador','Cuerpo del blog 2ada <br>',1,3,'Imagen pendiente','2023-01-01 11:01:00','2023-01-26 09:49:37'),(3,'3 Titulo-form-edit','456','Resument p<span style=\"background-color: rgb(255, 255, 0);\"><font color=\"#000000\">ost </font></span>update-<b><u>edit</u></b>','<p>Hola contenido <b>Del post, texto en negrita, </b><u>Texto en subrayado&nbsp;</u></p><p><u style=\"background-color: rgb(255, 255, 0);\"><font color=\"#000000\">Texto con background</font></u></p>',1,3,'uploads/blogs/va3kLIdUG1qdiKUoRUSP5d4dAyGNo7iwXsM3LQ7g.jpg','2023-01-05 11:03:41','2023-01-11 13:06:43'),(5,'Titulo 1704','987','Resumen','<p>Contenido <b>Negrita </b><span style=\"background-color: rgb(255, 255, 0);\"><font color=\"#000000\">asdfads</font></span><br></p>',1,3,'uploads/blogs/Vd3UfJEASU549H6zMOadDKjC9E59xAV7SwqcozOH.png','2023-01-05 15:05:23','2023-01-26 09:51:51'),(6,'6 2022: un año marcado por grandes logros y resultados','2022','asdf adf ad','<p style=\"font-family: Helvetica, sans-serif; margin-right: 0px; margin-bottom: 30px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; position: relative; color: rgb(103, 103, 103);\">¡Estamos orgullosos de cerrar el año 2022 con grandes resultados, tanto en el crecimiento como compañía como en nuestro firme compromiso con la sociedad!</p><p style=\"font-family: Helvetica, sans-serif; margin-right: 0px; margin-bottom: 30px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; position: relative; color: rgb(103, 103, 103);\">En el mes de julio&nbsp;<a href=\"https://atlantelt.com/atlante-duplica-su-tamano-y-se-posiciona-en-cataluna-con-la-integracion-de-proinvest/\" style=\"font: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(0, 0, 0);\">integramos a ProInvest</a>, compañía especializada en la prestación de servicios jurídicos, recuperación de deudas y gestión documental de créditos, tanto secured como unsecured. Este hito fue muy importante para la compañía, ya que no solo ampliamos nuestra oferta de servicios en la gestión extrajudicial sino que, además, nos posicionamos en Cataluña y duplicamos nuestro capital humano en toda la península a más de 200 empleados.</p><p style=\"font-family: Helvetica, sans-serif; margin-right: 0px; margin-bottom: 30px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; position: relative; color: rgb(103, 103, 103);\">Además, para continuar en la línea de líderes del sector, estuvimos presentes en los eventos más relevantes:</p><p style=\"font-family: Helvetica, sans-serif; margin-right: 0px; margin-bottom: 30px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; position: relative; color: rgb(103, 103, 103);\">Participamos como Platinum Sponsor en el Congreso Nacional de Crédito, organizado por el CMS, donde&nbsp;<a href=\"https://www.linkedin.com/in/sonia-benito-elices-34252427/\" style=\"font: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(0, 0, 0);\">Sonia Benito</a>, Managing director de Atlante, y&nbsp;<a href=\"https://www.linkedin.com/in/danieljaumeperez/\" style=\"font: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(0, 0, 0);\">Daniel Jaume</a>, Head of Sales and Business Development de la compañía, expusieron sus puntos de vista en distintos debates acerca de la necesaria colaboración público-privada.</p><p style=\"font-family: Helvetica, sans-serif; margin-right: 0px; margin-bottom: 30px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; position: relative; color: rgb(103, 103, 103);\">También asistimos como Platinum Sponsor en el 8º Legal Forum, organizado por el CMS, lo que, en palabras de&nbsp;<a href=\"https://www.linkedin.com/in/sonia-benito-elices-34252427/\" style=\"font: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(0, 0, 0);\">Sonia Benito</a>,&nbsp;<em style=\"font-family: inherit; margin: 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline;\">supuso una oportunidad para poner en valor la importancia de una correcta aplicación de la tecnología en el sector legal</em>.</p><p style=\"font-family: Helvetica, sans-serif; margin-right: 0px; margin-bottom: 30px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; position: relative; color: rgb(103, 103, 103);\">Nuestra participación continuó en el Servicing Inmobiliario, donde acudimos en calidad de Gold Sponsor y presentamos&nbsp;<a href=\"https://www.linkedin.com/company/oportunalia-activos/?viewAsMember=true\" style=\"font: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(0, 0, 0);\">Oportunalia</a>, la apuesta digital de&nbsp;<strong style=\"font-family: inherit; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline;\"><a href=\"https://www.linkedin.com/company/atlantelt/mycompany/?viewAsMember=true\" style=\"font: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(0, 0, 0);\">Atlante&nbsp;</a></strong>de realización de activos en ejecuciones hipotecarias.</p><p style=\"font-family: Helvetica, sans-serif; margin-right: 0px; margin-bottom: 30px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; position: relative; color: rgb(103, 103, 103);\">Siguiendo con la iniciativa de posicionarnos en el sector, fuimos parte de otros grandes eventos:</p><ul style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 20px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 30px; font-family: Arial, Helvetica, sans-serif; vertical-align: baseline; list-style-position: initial; list-style-image: initial; color: rgb(103, 103, 103);\"><li style=\"font: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;\">Global LegalTech Day, organizado por&nbsp;<a href=\"https://www.linkedin.com/company/global-legaltech-hub/\" style=\"font: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(0, 0, 0);\">GLTH</a>;</li><li style=\"font: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;\">Legal Tech Day, organizado por&nbsp;<a href=\"https://www.linkedin.com/company/derecho-pr-ctico/\" style=\"font: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; outline: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: rgb(0, 0, 0);\">Derecho Práctico&nbsp;</a>y Legal Shake;</li><li style=\"font: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;\">Spain Legal Expo;</li><li style=\"font: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;\">NPL Days Madrid de DDTalks.</li></ul><p style=\"font-family: Helvetica, sans-serif; margin-right: 0px; margin-bottom: 30px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; position: relative; color: rgb(103, 103, 103);\">Y, además, organizamos 4 webinars con expertos del sector público y privado, cuyos temas principales eran la digitalización de la Justicia y la Agenda 2030.</pn: relative; color: rgb(103, 103, 103);\">Y, por último, fuimos parte de la Subasta de Grandes Deseos, de la Fundación Pequeño Deseo, para poder cumplir los deseos de niños que padecen enfermedades graves y crónicas.</p><p style=\"font-family: Helvetica, sans-serif; margin-right: 0px; margin-bottom: 30px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; position: relative; color: rgb(103, 103, 103);\">Para finalizar este gran año, en el mes de noviembre realizamos un Gran Evento Propio: ¿Hacia una digitalización real de la Justicia?, donde pusimos en valor la digitalización de la Justicia Española a través de 9 grandes ponentes del sector, los cuales aportaron sus ideas en dos paneles de gran contenido.</p><p style=\"font-family: Helvetica, sans-serif; margin-right: 0px; margin-bottom: 30px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; position: relative; color: rgb(103, 103, 103);\">Gracias a todas estas acciones y al esfuerzo de todo el equipo que lo hace posible, cerramos el año con grandes números:</p><ul style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 20px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 30px; font-family: Arial, Helvetica, sans-serif; vertical-align: baseline; list-style-position: initial; list-style-image: initial; color: rgb(103, 103, 103);\"><li style=\"font: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;\">Incremento del negocio del 38%.</li><li style=\"font: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;\">+ 100 incorporaciones en plantilla.</li></ul><p style=\"font-family: Helvetica, sans-serif; margin-right: 0px; margin-bottom: 30px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; position: relative; color: rgb(103, 103, 103);\">¡Por un 2023 lleno de aprendizaje y de nuevas metas!</p><p class=\"has-medium-font-size\" style=\"font-family: Helvetica, sans-serif; margin-right: 0px; margin-bottom: 30px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; position: relative; color: rgb(103, 103, 103); font-size: var(--wp--preset--font-size--medium)  !important;\"><strong style=\"font-family: inherit; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline;\">¡Feliz año nuevo!</strong></p><p style=\"font-family: Helvetica, sans-serif; margin-right: 0px; margin-bottom: 30px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; position: relative; color: rgb(103, 103, 103);\">#SomosLegaltech #SomosAtlante #SomosLYRA #SomosPersonas</p>',1,3,'uploads/blogs/oOp9zokkvE8vvBQDxikriBmwbTK5hQcO7CuyMeBL.png','2023-01-11 13:21:50','2023-01-12 11:56:19'),(7,'1234567890  1234567890  12','slug-mayscyulas-minusculas','<p>&nbsp;<span style=\"font-size: 1rem;\">rESUMEN 01234567890 rESUMEN 01234567890 rESUMEN 01234567890 mi</span><span style=\"font-size: 1rem;\">rESUMEN 01&nbsp;&nbsp;</span><span style=\"font-size: 1rem;\">&nbsp;</span><span style=\"font-size: 1rem;\">rESUMEN 01234567890 rESUMEN 01234567890 rESUMEN 01234567890 mi</span><span style=\"font-size: 1rem;\">rESUMEN 01&nbsp;</span><span style=\"font-size: 1rem;\">&nbsp;</span><span style=\"font-size: 1rem;\">rESUMEN 01234567890 rESUMEN 01234567890 rESUMEN 01234567890 mi</span><span style=\"font-size: 1rem;\">rESUMEN 01</span></p>','<p>Contenido adf</p>',1,3,NULL,'2024-01-08 16:41:17','2024-01-09 09:02:29');
